PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE schools (
	id VARCHAR NOT NULL,
	name VARCHAR,
	link VARCHAR,
	national_rank VARCHAR,
	student_teacher_ratio VARCHAR,
	college_readiness VARCHAR,
	address VARCHAR,
	city VARCHAR,
	state VARCHAR,
	phone VARCHAR,
	district VARCHAR,
	reading_proficiency VARCHAR,
	grades VARCHAR,
	teachers VARCHAR,
	college_readiness_index VARCHAR,
	medal_awarded VARCHAR,
	math_proficiency VARCHAR,
	students VARCHAR, year DATE,
	PRIMARY KEY (id)
);
COMMIT;
